  selector: 'app-position-list',
  templateUrl: './position-list.component.html',
  styleUrls: ['./position-list.component.scss']
})
export class PositionListComponent {
  constructor( private router: Router) {

  }
  @Input()
  jobList: Job[] = []

  

}
